import React, { useState } from "react";
import axios from "axios";

const CarForm = () => {
  const [carData, setCarData] = useState({
    userEmail: "",
    price: "",
    carModel: "",
    maxSpeed: "",
    carType: "",
    duration: "",
    carColor: "",
    rentEndDate: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setCarData({ ...carData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post("http://127.0.0.1:3001/api/cars", carData);
      // Optionally, you can handle success here, like showing a success message or redirecting to another page.
      console.log("Car added successfully");
    } catch (error) {
      console.error("Error adding car:", error);
    }
  };

  return (
    <div>
      <h2>Add New Car</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="userEmail"
          placeholder="Owner's Email"
          value={carData.userEmail}
          onChange={handleChange}
        />
        <input
          type="text"
          name="price"
          placeholder="Price"
          value={carData.price}
          onChange={handleChange}
        />
        {/* Add other input fields for car details */}
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default CarForm;
